import React from "react";
import { useSpring, animated } from 'react-spring';

function AboutMe () {
const div1 = useSpring({
    delay: 500,
    to: async (next, cancel) => {
        await next({opacity: 1, transform: "scale(1) translateY(0)"})
        await next({opacity: 0.5, transform: "scale(0.5) translateY(5px)"})
        await next({opacity: 0, transform: "scale(0) translateY(10px)"})

    }, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})

const div2 = useSpring({
    delay: 1000,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div3 = useSpring({
    delay: 1500,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div4 = useSpring({
    delay: 2000,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div5 = useSpring({
    delay: 2500,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div6 = useSpring({
    delay: 3000,
    to: async (next, cancel) => {
        await next({opacity: 1, transform: "scale(1) translateY(0)"})
        await next({opacity: 0.5, transform: "scale(0.5) translateY(5px)"})
        await next({opacity: 0.25, transform: "scale(0.25) translateY(10px)"})
        await next({opacity: 0, transform: "scale(0) translateY(10px)"})
    }, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const jk = useSpring({
    delay: 3500,
    from: {opacity: 0, marginLeft: -2000},
    to: {opacity: 1, marginLeft: 250}
})
const odin = useSpring({
    delay: 4000,
    from: {opacity: 0, marginTop: 2000},
    to: {opacity: 1, marginTop: 0}
})

const transition = useSpring({
    to: async (next, cancel) => {
        await next({opacity: 0.5})
        await next({opacity: 1})
    },
    from: {opacity: 0}
  })


return(
    <animated.main style={transition} className="grid-container fluid AboutMe">
        <div className="grid-x grid-margin-x align-center-middle">
            <animated.div style={div1} className="cell small-12 medium-4 large-4 Kiel">
                Full Stack Developer
            </animated.div>
            <animated.div style={div2}className="cell small-12 medium-4 large-4 Kiel">
                Husband
            </animated.div>
            <animated.div style={div3} className="cell small-12 medium-4 large-4 Kiel">
                Veteran
            </animated.div>
            <animated.div style={div4} className="cell small-12 medium-4 large-4 Kiel">
                Brother
            </animated.div>
            <animated.div style={div5} className="cell small-12 medium-4 large-4 Kiel">
                Artist
            </animated.div>
            <animated.div style={div6} className="cell small-12 medium-4 large-4 Kiel">
                Uncle
            </animated.div>
        </div>
        <div className="grid-x grid-margin-x">
            <animated.div className="cell small-12 medium-4 large-4 Kiel self" style={{textAlign: "end", color: "#222", fontSize: "1.75em", paddingRight: "5px", ...jk }}>
                Jonathan & Kiel
            </animated.div>
            <animated.div className="cell small-12 medium-2 large-2 Kiel odin" style={{textAlign: "end", color: "#222", fontSize: "1.75em", paddingRight: "5px", ...odin }}>
                Odin
            </animated.div>
        </div>
    </animated.main>
);
}

export default AboutMe;
